programme.desc:
Captains George and Lain fish freshwater for the first time ever! With a small craft advisory issued for the coastal waters of the Florida Keys, the Guyz head to the north end of Key Largo to catch Peacock Bass in the Aerojet Canal. They inadvertently find themselves participating in a high-stakes fishing tournament after running into George's cousin, Earl Byrd III. 

Watch more of The Fish Guyz here: https://www.carbontv.com/shows/the-fish-guyz/

